import {
    HomeOutlined,
    UnorderedListOutlined,
  } from "@ant-design/icons";
export const NavWorkbookConstant = [{
    key: 'Charge',
    title: '成本信息',
    to: 'charge',
    icon:HomeOutlined
}, {
    key: 'Order',
    title: '订单详情',
    to: 'order',
    icon:UnorderedListOutlined
}]
